import React from 'react';

// LecturerScheduleView - Giao diện lecturerschedule cho admin (View trong MVC)
const LecturerScheduleView: React.FC = () => {
  return (
    <div className="max-w-6xl mx-auto">
      <div className="mb-6">
        <h1 className="text-3xl font-bold text-gray-900 mb-2">My Teaching Schedule</h1>
        <p className="text-gray-600">View your teaching schedule and class assignments</p>
      </div>

      <div className="card">
        <div className="text-center py-12">
          <h3 className="text-lg font-medium text-gray-900 mb-2">Teaching Schedule</h3>
          <p className="text-gray-600">This page will show your teaching schedule with class details and navigation to Tests/Grades/Materials.</p>
        </div>
      </div>
    </div>
  );
};

export default LecturerScheduleView;
